防音クッション付きなので、『カチャカチャ』<br>
音の鳴らないケースです☆彡
<br><br>
クッションが中身をしっかり押え、上下左右に<br>
揺れないので音が鳴りません！<br>
<br>
重ねる収納で、スリムなコンパクトタイプ♪<br>
<br>
ハシ＆スプーン＆フォークがセットの<br>
便利なトリオセット。 (^O^)v<br>
<br>
食洗機、乾燥機ＯＫ！！<br>
<br>
○ハシ、スプーン、フォークの長さ：１８cm<br>
○ケースサイズ：約188×37×27mm<br>
<br>
≪品質表示≫<br>
フタ：ＡＳ樹脂／耐熱温度100度<br>
本体：ＡＢＳ樹脂／耐熱温度100度<br>
ハシ：メタクリル樹脂／耐熱温度100度<br>
スプーン：ＡＢＳ樹脂／耐熱温度100度<br>
フォーク：ＡＢＳ樹脂／耐熱温度100度<br>
クッション：シリコン樹脂／耐熱温度140度<br>
<br>
◆日本製<br>
<br>
【関連ワード】
<br>
スケーター/箸/スプーン/セット/弁当箱/お弁当/ランチ/子供用/入園/入学/通園/通学/通勤/ピクニック/行楽/運動会/遠足/お出かけ<BR>

