食器洗い乾燥機ＯＫのお箸・フォーク・スプーンと<br>ケースのセットです。<br>
<br>
ケースは、指で引き出すスライド式で、<br>
衝撃に強くこわれにくい丈夫な構造です。<br>
<br>
また、洗いやすく分解可能になっています。<br>
<br>
おハシには名前を入れられるスペース付き。<br>
<br>
ケース用の名前シールも付いてます。<br>
<br>
○商品サイズ<br>
・ケースサイズ：206×82×17mm<br>
・ハシの長さ：16.5cm<br>
・スプーン、フォーク：全長13cm<br>
<br>
≪品質表示≫<br>
・フタ：ＡＳ樹脂／耐熱温度100度<br>
